<!DOCTYPE html>
<html>
<head>
    <title>pyDraw</title>
    <style type="text/css">
            *{
                margin: 0;
                padding: 0;

            }
            html,body{
                width:90%;
                margin:auto;

            }
        .container{
            width: 80%;
            height:auto;
            margin: auto;
            margin-top: 5%;

            display:flex;
            flex-wrap: wrap;
            flex-direction: row;
            justify-content: space-around;
            /*align-items: center;*/

            position: relative;

        }

        .originalPic{
                margin:10px;
                width: 45%;
                height: auto;
                /*float: left;*/
                /*border:1px solid black;*/

                min-width: 400px;
            }
        .originalPic Img{
            width:100%;
            height: auto;
        }
        .drawing{
            margin-top: 10px;
            min-width: 400px;
            width:45%;
            height:auto;
            /*float:right;*/
            border:1px solid black;
            background-color: rgba(254, 240, 240, 0.6);

            box-shadow: 1px 1px 10px 1px #484a4a;



             border-image-slice: 1;
              border-width: 1px;
              border-image-source: linear-gradient(to left, #743ad5, #d53a9d);


        }

        .drawing canvas{
            width:100%;
            height:auto;

        }

        h1{
            text-align: center;
            font-style: italic;
            font-family: cursive;
            text-decoration: underline;
            letter-spacing: 2px;
            font-weight: lighter;
            padding: 10px;

            color: #b607d9;



            text-shadow: 3px 3px 2px black;

        }



        #particles-js{
            height: 100%;
            width : 100%;
            /*background-color: #240142;*/
          background-image: linear-gradient(to right bottom, #061f55, #1e1a50, #2b144a, #340e43, #3b063b);
            position: absolute;
            z-index: -5;
            top:0;
            left: 0;

        }

        .buttons{
            width:100%;
            margin-top: 1%;
            display: flex;
            justify-content: center;
        }
        #start{
            width: 15%;
            height: 7vh;


              border-image-slice: 1;
              border-width: 1px;
              border-image-source: linear-gradient(to left, #743ad5, #d53a9d);
            background-color: black;
            font-size: 20px;
            color: white;
            letter-spacing: 2px;
            outline: none;
        }




        #start:hover{
            border:2px solid #802a31;
        }
        #start:active{
            transform: scale(0.99);
            background-color: #1e1e38;
        }
        #start:disabled{
           border:2px solid #802a31;

        }

    </style>
</head>

function sleep(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}


function EuclideanDistance(current,next){
    return Math.sqrt(Math.pow((current[1]-next[1]),2)+Math.pow((current[0]-next[0]),2))
}

async function draw() {
    let Path;
    let currPos;
    let index;
    for (let i = 0 ; i < connectedList["paths"].length;i++){

        path = connectedList["paths"][i]["coordinates"];

        ctx.moveTo(path[0][1],path[0][0]);

        currPos = path[0] ;

        // remove currPos from path
        path.splice(0,1);

        index = 0 ;
        while(path.length  > 1){

            if (EuclideanDistance(currPos,path[index]) > 1 && EuclideanDistance(currPos,path[index+1]) > 1){  // if distance between curr pos and two consecutive pix are greater than 2
                    // index += 2;
                    ctx.moveTo(path[index][1],path[index][0]);
                    currPos = path[index];
                    path.splice(index,1);


            }
            else if ( EuclideanDistance(currPos,path[index]) > 1 ){   // if the distance between currPos and the next pix is greater than 1 and currPos and next+1 pix is equals to one
                index += 1;
                ctx.lineTo(path[index][1],path[index][0]);
                currPos = path[index];

                path.splice(index,1);

            }
            else{ //if the distance between currPos and the next pix is one then

                ctx.lineTo(path[index][1],path[index][0]);
                currPos =  path[index]
                path.splice(index,1);


            }

        ctx.stroke();
        await sleep(0);

        // restart index if it exceed the path.length
            if (index > (path.length - 2) ){
                index = 0;

            }

        }

    }
}

 btn.value = " ...."
